import { useEffect, useState } from 'react';
import axios from 'axios';

const baseurl = 'http://127.0.0.1:8000/api/'

function Register() {
  const [studentData, setStudentData]=useState({
    'full_name':'',
    'email':'',
    'password':'',
    'username':'',
    'interest':'',
    'status':'',
  });

  // Update elements value
  const handleChange=(event)=>{
    setStudentData({
      [event.target.name]:event.target
    });
  }

  useEffect(() => {
    document.title = 'Student Register';
  });
    return(
        <div className='container mt-4'>
            <div className='row'>
                <div className='col-6 offset-3'>
                    <div className='card'>
                        <h5 className='card-header'>User Register</h5>
                        <div className='card-body'>
                        <form>
                          <div className="mb-3">
                            <label for="exampleInputEmail1" className="form-label">Full Name</label>
                            <input type="email" className="form-control" />
                          </div>
                          <div className="mb-3">
                            <label for="exampleInputEmail1" className="form-label">Email</label>
                            <input type="email" className="form-control" />
                          </div>
                          <div className="mb-3">
                            <label for="exampleInputEmail1" className="form-label">Username</label>
                            <input type="email" className="form-control" />
                          </div>
                          <div class="mb-3">
                            <label for="exampleInputPassword1" className="form-label">Password</label>
                            <input type="password" className="form-control" id="exampleInputPassword1" />
                          </div>
                          <div className="mb-3">
                            <label for="exampleInputEmail1" className="form-label">Interest(s)</label>
                            <textarea className='form-control'></textarea>
                            <div id="emailHelp" class="form-text">Fashion, Programming, Music, Gaming, etc.</div>
                          </div>
                          <button type="submit" className="btn btn-primary">User Register</button>
                        </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Register;
